import React from "react";

function SocialItem(props) {

    return (
        <li className="list-group-item">
            <img src="" />
            <input type={"checkbox"} id={props.id} />
            <label for={props.id}>{props.name}</label>
        </li>
    )
}

export default SocialItem;
